import React from "react";
import { Form, Input } from "antd";

const Login = () => {
  return (
    <Form>
      <div>
        <label htmlFor="uId">아이디</label>
        <Input name="uId"></Input>
        <label htmlFor="password">비밀번호</label>
        <Input name="password"></Input>
      </div>
    </Form>
  );
};

export default Login;
